var f;
var fAmm = 4;
var fW = 120;
var endF;

var coin_base64 = "data:image/png;base64,";
var coin_img = new Image;
coin_img.src = coin_base64;









function animCoins(){
	initCircles2();

	gsap.set(o.cta, {opacity: 1, scale: 0, transformOrigin: "50% 65%"})
	gsap.to(o.cta, 0.85, {delay: 0.5, scale: 1, transformOrigin: "50% 65%", ease: Back.easeOut})

	gsap.set(o.end, {opacity: 1, scale: 0, transformOrigin: "50% 65%"})
	gsap.to(o.end, 0.85, {delay: 0.5, scale: 1, transformOrigin: "50% 65%", ease: Back.easeOut})

	gsap.to(o.scaleCont, 0.65, {delay: 0.7, autoAlpha: 0, ease: "power1.in"})
	gsap.to(o.text, 0.65, {delay: 0.7, autoAlpha: 0, ease: "power1.in"})

}

function animFruits(){
	// console.log("animFruits");
	// endF = rfID();
	endF = 0;

	f = [
  		{
  			cur: 0,
  			ch: [-1, -1],
  			ids: [rfID(), rfID()],
  			el: [o.f1, o.f4]
  		},
  		{
  			cur: 0,
  			ch: [-1, -1],
  			ids: [rfID(), rfID()],
  			el: [o.f2, o.f5]
  		},
  		{
  			cur: 0,
  			ch: [-1, -1],
  			ids: [rfID(), rfID()],
  			el: [o.f3, o.f6]
  		},
	]


	for(var i=0; i<f.length; i++){
		// var i = 0;
		animFruitRow( i );
	}

	setTimeout(animCoins, 2500)

	// console.log("animFruits END");

}

function animFruitRow( i ){
	// console.log("animFruitRow", f[i]);
	var h = 230;
	var dur = 2.2 + i * 0.75;
	var ease = "power3.out"
	var spinAmm = 8;

	var next_cur = (spinAmm + 0.48) * h;
	var item = f[i];
	var delay = i * 0.05;

	gsap.to(item, dur, {delay: delay, cur: next_cur, ease: ease, onUpdate: function(){
		// console.log( this.vars.cur );

		var val = this.vars.cur;
		var y = item.cur % h;
		var y2 = (item.cur-h/2) % h;

		var el = item.el[0];
		var el2 = item.el[1];

		gsap.set(el, {y: y})
		gsap.set(el2, {y: y2})

		for(var j=0; j<=1; j++){

			var ch = (j == 0) ? (item.cur - y) / h : (item.cur-h/2 - y2) / h;

			if(ch != item.ch[j]){
				item.ch[j]++;
				var new_id = rfID();
				if(ch == spinAmm && j == 0){
					new_id = endF;
					// console.log(new_id)
				}
				item.ids[j] = new_id;
				// console.log(new_id);
				var x = fW * item.ids[j];
	  			item.el[j].style.backgroundPosition = x + "px 0px";
			}

		}
	}})

}

function rfID(){ // random fruit id
	return Math.floor( Math.random() * fAmm );
}